@maiseltv's Mei Lin is a plucky 3 year old, 16lb terrier mix best known as Joel's quirky love interest but this tiny fast-talker can help you navigate the underground gambling den scene all while keeping up her grades in med school. Whether it's a liquor license you're looking for or a lifetime of cuddles, this guard dog goddess of Chinatown is your girl! 
#ssrMeiLin is spayed, up to date on vaccines and microchipped. 
